import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      price: null,
      list: null
    };

    this.onGetStockPrice = this.onGetStockPrice.bind(this);
    this.createList = this.createList.bind(this);
  }

  onGetStockPrice() {
    fetch("https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=demo", {
      method: 'GET',
      headers: {
        Accept: 'application/json'
      }
    })
      .then(response => response.json())
      .then(json => {
        this.setState({price: json['Time Series (5min)']});
      })
      .then(console.log('operation completed'))
  }

  createList() {

    for (let i = 0; i < this.state.price; i++) {
      console.log(this.state.price[i])
      this.state.list.push(<li>
        {
          this.state.price[i]
        }
      </li>)
    }
    return this.state.list;
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <input
            id = "ticker-input"
            type="text"
            placeholder="Enter search ticker..."
          />
          <div>
            <button onClick={this.onGetStockPrice}>Today's Stock Price</button>
            <ul>{this.createList()}</ul>
          </div>
        </header>
      </div>
    );
  }

}

export default App;
